import { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

//Icons
import FacebookRoundedIcon from '@mui/icons-material/FacebookRounded';
import AddLocationRoundedIcon from '@mui/icons-material/AddLocationRounded';
import ContactlessRoundedIcon from '@mui/icons-material/ContactlessRounded';
import MailRoundedIcon from '@mui/icons-material/MailRounded';

//Rows
import { styled } from '@mui/material/styles';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';


import { Button } from '@mui/material';

const Footer = (props) => {

    const navigate = useNavigate();

    const Item = styled(Paper)(({ theme }) => ({
        backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
        ...theme.typography.body2,
        padding: theme.spacing(1),
        textAlign: 'center',
        color: theme.palette.text.secondary,
      }));

    const [anchorEl, setAnchorEl] = useState(null);
    const open = Boolean(anchorEl);

    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleClose = () => {
        setAnchorEl(null);
    };

    return (
        <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
            <Grid item xs={6}>
                <Item>1</Item>
            </Grid>
            <Grid item xs={6}>
                <Item>2</Item>
            </Grid>   
        </Grid>

       /* <div class="footer">
            <div class="heads">
                <h3 class="">Features</h3>
                <h3 class="">Enterprise</h3>
                <h3 class="">Support</h3>
                <h3 class="">ICO</h3>
            </div>

            <div class="icons">
                <Button startIcon={<FacebookRoundedIcon />}/>
                <Button startIcon={<AddLocationRoundedIcon />}/>
                <Button startIcon={<ContactlessRoundedIcon />}/>
                <Button startIcon={<MailRoundedIcon />}/>
            </div>

            <h4 class="copyright">All rights reserved</h4>
        </div> */
    );
};

export default Footer;
